        IF (SENSE SWITCH 1) 10, 20
        IF (SENSE SWITCH 2) 30, 40
        IF (SENSE SWITCH 3) 50, 60
        IF (SENSE SWITCH 4) 70, 80
        IF (SENSE SWITCH 5) 90, 100
        IF (SENSE SWITCH 6) 110, 120
10      CONTINUE
20      CONTINUE
30      CONTINUE
40      CONTINUE
50      CONTINUE
60      CONTINUE
70      CONTINUE
80      CONTINUE
90      CONTINUE
100     CONTINUE
110     CONTINUE
120     CONTINUE
        END
